import React from 'react';

const TableItem = (props) => {

    const {name, height, mass} = props;

    return (
        <table>
            <tr>
                <td>{name}</td>
                <td>{height}</td>
                <td>{mass}</td>
            </tr>
        </table>
    );
}

export default TableItem;
